import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "../styles/Accepted.css"; // Importing the CSS file

const CompletionScore = () => {
    const [completionScore, setCompletionScore] = useState(null);

    useEffect(() => {
        axios.get('http://localhost:5000/api/completion-score')
            .then(response => {
                setCompletionScore(response.data.completionScore);
            })
            .catch(error => {
                console.error('There was an error fetching the completion score!', error);
            });
    }, []);

    return (
        <div className="container">
            <h1 className="heading-style">Completion Score</h1>
            {completionScore !== null ? (
                <p>The completion score is {completionScore.toFixed(2)}%</p>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
};

export default CompletionScore;
